import './App.css';
import './index.css';

function App() {
  return (
    <div className="App">
      <header>
        <ul>
          <li>Senior Frontend Developer</li>
          <li>Fullstack Developer</li>
          <li>Junior Frontend Developer</li>
          <li>Software Engineer</li>
          <li>Junior Backend Frontend Developer</li>
          <li>Fullstack Engineer</li>
        </ul>

      </header>
    </div>
  );
}

export default App;
